import React, { Component } from "react";
import "../styles/Home.scss";
import Download from "../assets/icon/Download-icon.svg";
import Device from "../assets/icon/Cardiogram-icon.svg";
import Notification from "../assets/icon/Notification-icon.svg";

class Home extends Component {
  render() {
    const Columns = () => (
      <div
        style={{
          display: "grid",
          gridTemplateColumns: "repeat(3, 1fr)",
          gridGap: 20,
        }}
      >
        <div class="download">
          <img src={Download} />
          <p>Download the excel template and fill out according to your inventory</p>
        </div>
        <div class="device">
          <img src={Device} />
          <p>Upload your form to our website and we will monitor your updates</p>
        </div>
        <div class="notification">
          <img src={Notification} />
        </div>
      </div>
    );

    return (
      <div id="home">
        <h1>
          Discover <span>safer</span> medical devices.
        </h1>
        <Columns />
      </div>
    );
  }
}

export default Home;
